import axios from 'axios';
import React from 'react'
import { useState, useEffect } from 'react';
import './App.css';
import Card from './Card';

function App() {
    const [user, setUser] = useState([]);
    async function getData(){
        const res = await axios.get('https://api.github.com/users');
        setUser(res.data);
    }
    
    useEffect(()=>{
        getData();
    }, [])
    
    return (
        <>
            <div style={{height:"10vh", display:"flex", justifyContent:"center", ali}}><h1>Github User</h1></div>
            <div style={{display:"flex", justifyContent:"space-around", flexWrap:"wrap", gap:"1.5rem", marginTop:"50px"}}>
                {
                    user.map((ele,index)=>(
                        <Card 
                            key={index+index} 
                            img_url ={ele?.avatar_url} 
                            name={ele?.login}
                            id = {ele?.id}
                        />
                    ))
                }
            </div>
        </>
    )
}

export default App
